import styles from './Nav.module.scss';

const Nav = () => {
  return (
    <div className="row">
      <div className="col-6"><a href="/home">Waiter.app</a></div>
      <div className="col-6"><a href="/home">Home</a></div>
    </div>

  );
};

export default Nav;
